import { FormGroup, FormControl, FormArray } from '@angular/forms';

export function moveItemInFormArray(form_array: FormArray, from_index: number, to_index: number) {
  const dir = to_index > from_index ? 1 : -1;

  const from = from_index;
  const to = to_index;

  const temp = form_array.at(from);
  for (let i = from; i * dir < to * dir; i = i + dir) {
    const current = form_array.at(i + dir);
    form_array.setControl(i, current);
  }
  form_array.setControl(to, temp);
  // optional
  form_array.controls.forEach((x, index, arr) => {
    x.get('sort_by').setValue(index + 1);
  });
}

